met de stemmen van Diong Chae Lian, Gavin Yap en Christina Orow

De kleine bamboehaai Pup en Julius, een witpunthaai, leven in de oceaan in de buurt van een rif. Als dieven grote hoeveelheden 
kuit stelen uit datzelfde rif, gaan Pup en Julius op weg om hun broertjes en zusjes te redden. Met behulp van een mechanisch 
vissenpak slagen ze er in om de dieven op te sporen en zelfs te achtervolgen over de grenzen van het water, tot op het land...
